import React from 'react'
import styled from 'styled-components'
import { PostContent } from '@UI/Molecules'
import { PostActions } from '@UI/Molecules/PostActions'

const Item = styled.div`
	text-align: center;
`
interface PropsType {
	onEdit: (id: number) => void
	onDelete: (id: number) => void
	title: string
	body: string
	id: number
}
export const PostItem: React.FC<PropsType> = ({
	title,
	body,
	id,
	onEdit,
	onDelete,
}): React.ReactElement => {
	return (
		<Item>
			<PostContent title={title} body={body} />
			<PostActions id={id} onEdit={onEdit} onDelete={onDelete} />
		</Item>
	)
}
